import React from 'react';

// if only generating HTML we can use a Stateless Functional Component.
// We can use this instead of calling the render function

const Header = (props) => (
  <header className="top">
    <h1>
      Catch
      <span className="ofThe">
        <span className="of">OF</span>
        <span className="the">THE</span>
      </span>
      Day
    </h1>
    <h3 className="tagline">
      <span>{props.tagline}</span>
    </h3>
  </header>
);

